import { useEffect, useState } from 'react';
import Button from './Button.js';

function Liste_page(){
    return(
        <div class = "container" style={{ backgroundColor: '#202730' }}>
            <div class = "row">
                <Button text ="Mathématique" className = "matière">Mathématique</Button>
                <Button text ="Français" className = "matière">Français</Button>
                <Button text ="Histoire" className = "matière">Histoire</Button>
                <Button text ="Physique Chimie" className = "matière">Physique Chimie</Button>
            </div>
        </div>
    )
}

export default Liste_page;
